  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Wheeler National
  Wildlife Refuge outlines Refuge accomplishments from September to December 1953.
  The report begins by summarizing the weather conditions and water conditions during
  the period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections, receipts, and prescribed
  burning. Resource management is outlined; topics include grazing, haying, fur harvesting,
  and timber removal. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes physical
  developments, Refuge visitors, recreational uses, hunting, fishing, violations,
  and safety. Attachments include items of interest, N-R forms, and photographs.\",\n\t\"license_title\":
